import React from "react";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
import { Sidebar, SidebarItem } from "@/components/ui/sidebar";
import { BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer } from "recharts";
import { useState } from "react";

const Dashboard = () => {
  const [activeTab, setActiveTab] = useState("overview");

  const data = [
    { name: "Low Risk", value: 40 },
    { name: "Medium Risk", value: 30 },
    { name: "High Risk", value: 15 },
    { name: "Critical", value: 5 },
  ];

  return (
    <div className="flex min-h-screen bg-gray-100">
      {/* Sidebar */}
      <Sidebar>
        <SidebarItem label="Overview" onClick={() => setActiveTab("overview")} />
        <SidebarItem label="Exams" onClick={() => setActiveTab("exams")} />
        <SidebarItem label="Flagged Events" onClick={() => setActiveTab("flags")} />
        <SidebarItem label="Settings" onClick={() => setActiveTab("settings")} />
      </Sidebar>

      {/* Main Content */}
      <div className="flex-1 p-6">
        {activeTab === "overview" && (
          <>
            <h1 className="text-2xl font-bold mb-4">Admin Dashboard</h1>
            <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
              <Card>
                <CardContent>
                  <h2 className="text-lg font-semibold">Total Exams</h2>
                  <p className="text-xl font-bold">120</p>
                </CardContent>
              </Card>
              <Card>
                <CardContent>
                  <h2 className="text-lg font-semibold">Active Users</h2>
                  <p className="text-xl font-bold">450</p>
                </CardContent>
              </Card>
              <Card>
                <CardContent>
                  <h2 className="text-lg font-semibold">Flagged Incidents</h2>
                  <p className="text-xl font-bold text-red-500">15</p>
                </CardContent>
              </Card>
            </div>

            <div className="mt-6 bg-white p-4 rounded-lg shadow">
              <h2 className="text-lg font-semibold mb-2">Risk Analysis</h2>
              <ResponsiveContainer width="100%" height={300}>
                <BarChart data={data}>
                  <XAxis dataKey="name" />
                  <YAxis />
                  <Tooltip />
                  <Bar dataKey="value" fill="#8884d8" />
                </BarChart>
              </ResponsiveContainer>
            </div>
          </>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
